column8:
　長く使えるシンプルなデザインが人気！PUMAの鉛筆！<br>
同じデザインの定規や消しゴムで揃えればもっとかっこいい☆<br>
鮮やかなカラーのプリントが◎！<br>
<br>
【仕様】<br>
・パッケージサイズ：H200×W48×D16ｍｍ<br>
・芯：B<br>
・六角軸<br>
・12本組<br>
・日本製<br>
<br>
