　赤鉛筆がセットになった贈り物に最適な<br>
トンボのかきかた鉛筆です。<br>
明るいパッケージは年代問わず贈れる嬉しいデザインです。<br>
<br>
無地の短冊も付いているので、好きな言葉を入れて<br>
プレゼントすることもできます☆<br>
<br>
【カラーバリエーション】<br>
・ピンク<br>
・グリーン<br>
<br>
【仕様】
・六角軸<br>
・芯：2B<br>
<br>
【セット内容】<br>
・かきかた鉛筆×10本<br>
・丸つけ用赤鉛筆×2本<br>
・MONO消しゴム×1個<br>
・短冊：おめでとう×1枚、無地×1枚<br>
<br>
※鉛筆のお名前入れ無料で承ります！<br>
※短冊への文字印刷・名前入れは受付できません。<br>
<br>
