　オーソドックスな三菱鉛筆から赤鉛筆が発売されました。

注意<br>
<br>六角軸に比べてこの赤鉛筆は丸軸の為、名入れの文字か半分以上かけたり、
<br>文字が凹んだりする場合がございます！！
<br>鉛筆によって木の硬さが違います。
<br>名入れ希望の場合は、名入れさせていただきますが、
<br>返品等はお受け出来ませんのでご発注の際には了承してくださいませ♪<br><br>

