　妖怪ウォッチの新入学文具が登場です！<br>
大好きな妖怪たちと一緒なら勉強も楽しくなっちゃう！<br>
<br>
丈夫な缶ケースに入った色鉛筆12色のセットです！<br>
工作の時間はもちろん！休み時間のお絵かきにも<br>
大活躍すること間違いなし☆<br>
鉛筆軸にもキャラクターのプリント入り♪<br>
<br>
【仕様】<br>
・本体サイズ：約185×102×11ｍｍ<br>
・12色<br>
・缶ケース入り<br>
